import React from 'react';
import {Button,ButtonGroup,ButtonToolbar } from 'reactstrap';

function Nav() {
  return (
    <div>
      <ButtonToolbar>
        <ButtonGroup size="10px">
          <Button> Stage1 </Button>
          <Button> Stage2 </Button>
          <Button> Stage3 </Button>
          <Button> Stage4 </Button>
          <Button> Stage5 </Button>
        </ButtonGroup>
      </ButtonToolbar>
    </div>
  );
}

export default Nav;
